import React from 'react'
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import CardActionArea from '@mui/material/CardActionArea';
import InteviewPortal from "./InteviewPortal";
const cards = [
    {
      id: 1,
      title: 'Total Categary',
      description: '4',
    },
    {
      id: 2,
      title: 'Total Sub Category',
      description: '2',
    },
    {
      id: 3,
      title: 'Total Q / A',
      description: '3',
    },
  ];
const DashBoard = () => {
    const [selectedCard, setSelectedCard] = React.useState(0);
  return (
    <InteviewPortal>
      <Box
      sx={{
        width: '100%',
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fill, minmax(min(300px, 100%), 1fr))',
        gap: 2,
      }}
    >
      {cards.map((card, index) => (
        <Card>
          <CardActionArea
            onClick={() => setSelectedCard(index)}
            data-active={selectedCard === index ? '' : undefined}
            sx={{
              height: '100%',
              '&[data-active]': {
                backgroundColor: 'action.selected',
                '&:hover': {
                  backgroundColor: 'action.selectedHover',
                },
              },
            }}
          >
            <CardContent sx={{ height: '100%'}}>
              <Typography variant="h5" component="div" sx={{justifyContent:'center',display:'flex'}}>
                {card.title}
              </Typography>
              <Typography variant="h3" color="text.secondary" sx={{justifyContent:'center',display:'flex'}}>
                {card.description}
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
      ))}
    </Box>
    </InteviewPortal>
  )
}

export default DashBoard
